    false,nt"url": null,nt"notes": "This annual narrative report for Bear River
    Migratory Bird Refuge outlines Refuge accomplishments during the 1975 fiscal year.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover conditions during the year. Wildlife- including migratory
    birds, upland game birds, furbearers, predators, rodents, raptors, and diseases-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, and collections and receipts. Resource management is outlined;
    topics include fur harvesting and commercial fishing. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge participation, hunting, violations,
    and safety. Photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
